import { FaPlus } from 'react-icons'


const Main = () => {
    return (
        <div>
           <Container>
            <Button style={{width: '220px', height: '220px', fontSize: '140px'}}><FaPlus /></Button>
            <Button>\\</Button>
           </Container>
        </div>
    )
}

export default Main
